import React from 'react';

import Pomodoro from "./components/pomodoro";

function App() {
  const timer = ({time, startFn, endFn, intervalFn}) => {
    startFn = startFn ? startFn(): null;

    let timeCounter = 0;

    const interval = setInterval(() => {
      timeCounter++;

      intervalFn({timeCounter})
    }, 1000)

    setTimeout(() => {
      endFn = endFn ? endFn(): null; 

      clearInterval(interval);

    }, time)
  }

  timer({
    time: 5000,

    startFn: () => {
      console.log("start");
    },

    endFn: () => {
      console.log("end")
    },

    intervalFn: () => {
      console.log("abra")
    }
  })


  return (
    <Pomodoro
      onChangeBreakLength={() => console.log(1)}
      onChangeSessionLength={() => console.log(1)}

      onClickStart={() => console.log(1)}
      onClickStop={() => console.log(1)}
      onClickReset={() => console.log(1)}

      display={"00:00:00"}
    />
  );
}

export default App;
